Use either a very large unclutter table or Cool Whip containers to temporarily store the unused pieces. Technic pieces are styled into several types of pieces which include
Bricks are just like any other Lego-piece. Bricks don't play too big of a role in Lego Technic models however. {"smallUrl":"https://www.wikihow.com/images/thumb/6/60/Assemble-a-LEGO-Technic-Model-Step-3Bullet1-Version-2.jpg/v4-460px-Assemble-a-LEGO-Technic-Model-Step-3Bullet1-Version-2.jpg","bigUrl":"/images/thumb/6/60/Assemble-a-LEGO-Technic-Model-Step-3Bullet1-Version-2.jpg/aid2709751-v4-728px-Assemble-a-LEGO-Technic-Model-Step-3Bullet1-Version-2.jpg","smallWidth":460,"smallHeight":345,"bigWidth":"728","bigHeight":"546","licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
</p><p><br />
</p></div>"}

Pins help join and make the piece rotate to make the model move and connect one piece to another. {"smallUrl":"https://www.wikihow.com/images/thumb/f/f8/Assemble-a-LEGO-Technic-Model-Step-3Bullet2-Version-2.jpg/v4-460px-Assemble-a-LEGO-Technic-Model-Step-3Bullet2-Version-2.jpg","bigUrl":"/images/thumb/f/f8/Assemble-a-LEGO-Technic-Model-Step-3Bullet2-Version-2.jpg/aid2709751-v4-728px-Assemble-a-LEGO-Technic-Model-Step-3Bullet2-Version-2.jpg","smallWidth":460,"smallHeight":345,"bigWidth":"728","bigHeight":"546","licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
</p><p><br />
</p></div>"}

Beams are mainly decorative pieces, however, they do play a key role in making the model "come alive". {"smallUrl":"https://www.wikihow.com/images/thumb/4/44/Assemble-a-LEGO-Technic-Model-Step-3Bullet3-Version-2.jpg/v4-460px-Assemble-a-LEGO-Technic-Model-Step-3Bullet3-Version-2.jpg","bigUrl":"/images/thumb/4/44/Assemble-a-LEGO-Technic-Model-Step-3Bullet3-Version-2.jpg/aid2709751-v4-728px-Assemble-a-LEGO-Technic-Model-Step-3Bullet3-Version-2.jpg","smallWidth":460,"smallHeight":345,"bigWidth":"728","bigHeight":"546","licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
</p><p><br />
</p></div>"}

Bushes and joints also help secure axles to their associated pieces. {"smallUrl":"https://www.wikihow.com/images/thumb/2/22/Assemble-a-LEGO-Technic-Model-Step-3Bullet4-Version-2.jpg/v4-460px-Assemble-a-LEGO-Technic-Model-Step-3Bullet4-Version-2.jpg","bigUrl":"/images/thumb/2/22/Assemble-a-LEGO-Technic-Model-Step-3Bullet4-Version-2.jpg/aid2709751-v4-728px-Assemble-a-LEGO-Technic-Model-Step-3Bullet4-Version-2.jpg","smallWidth":460,"smallHeight":345,"bigWidth":"728","bigHeight":"546","licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
</p><p><br />
</p></div>"}

Power and transmission systems vary by model, however, just like on an automobile, they provide the necessary "get up and go" "juice" to perform the models' movement (if they need to be powered){"smallUrl":"https://www.wikihow.com/images/thumb/5/52/Assemble-a-LEGO-Technic-Model-Step-3Bullet5-Version-2.jpg/v4-460px-Assemble-a-LEGO-Technic-Model-Step-3Bullet5-Version-2.jpg","bigUrl":"/images/thumb/5/52/Assemble-a-LEGO-Technic-Model-Step-3Bullet5-Version-2.jpg/aid2709751-v4-728px-Assemble-a-LEGO-Technic-Model-Step-3Bullet5-Version-2.jpg","smallWidth":460,"smallHeight":345,"bigWidth":"728","bigHeight":"546","licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
</p><p><br />
</p></div>"}

Chains and pulley's are also a necessary item and connect the motor to the transmission. {"smallUrl":"https://www.wikihow.com/images/thumb/3/30/Assemble-a-LEGO-Technic-Model-Step-3Bullet6-Version-2.jpg/v4-460px-Assemble-a-LEGO-Technic-Model-Step-3Bullet6-Version-2.jpg","bigUrl":"/images/thumb/3/30/Assemble-a-LEGO-Technic-Model-Step-3Bullet6-Version-2.jpg/aid2709751-v4-728px-Assemble-a-LEGO-Technic-Model-Step-3Bullet6-Version-2.jpg","smallWidth":460,"smallHeight":345,"bigWidth":"728","bigHeight":"546","licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
</p><p><br />
</p></div>"}

